import React from "react";
import {
  SideBar,
  SideBarWrapper,
  SideBarMenu,
  SideBarTitle,
  SideBarListItem,
  SideBarList,
  Logo,
} from "./SideBarElements.js";
import { AiOutlineDashboard, AiOutlineSetting } from "react-icons/ai";
import { BiMessageSquareDetail } from "react-icons/bi";
import { RiAccountCircleLine } from "react-icons/ri";
const SideBarDD = () => {
  return (
    <>
      <SideBar>
        <SideBarWrapper>
          <Logo>TECH</Logo>
          <SideBarMenu>
            <SideBarTitle>PAGES</SideBarTitle>
            <SideBarList>
              <SideBarListItem>
                <AiOutlineDashboard />
                DASHBOARD
              </SideBarListItem>
              <SideBarListItem>
                <AiOutlineSetting />
                SETTINGS
              </SideBarListItem>
              <SideBarListItem>
                <BiMessageSquareDetail />
                MESSAGES
              </SideBarListItem>
              <SideBarListItem>
                <RiAccountCircleLine />
                ACCOUNT
              </SideBarListItem>
            </SideBarList>
          </SideBarMenu>
        </SideBarWrapper>
      </SideBar>
    </>
  );
};

export default SideBarDD;
